package ch2;

public class OperEx4 {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 20;
		boolean c = a < b; // 변수 a가 변수 b보다 작다.
		System.out.println("a < b : " + c);
		
		c = a != b; // 변수 a와 변수 b는 같지 않다.
		System.out.println("a != b : " + c);
	}

}
